import React from 'react';
import {Link} from 'react-router-dom';
import './NavBar.scss';

export default function NavBar() {
    return (
        <div className="navbar">

            <Link to="/">Home</Link>
            <Link to="/about">About</Link>
            <Link to="/facts">Facts</Link>
            <Link to="/contact">Contact</Link>
        </div>
    )
}
